import React, { Component } from 'react';
import { TabList, Tab } from 'react-tabs';

class TabComponent extends Component {
    render() {
        return (
            <div>
                <Tabs>
                    <TabList>
                        <Tab>Tab Link 1</Tab>
                        <Tab>Tab Link 2</Tab>
                    </TabList>
                </Tabs>

            </div>
        );
    }
}

export default TabComponent;
